import React from 'react';
import PropTypes from 'prop-types';

ToDoList.propTypes = {
  listToDo: PropTypes.array,
  clickToItem: PropTypes.func
};

ToDoList.defaultProps = {
  listToDo: [],
  clickToItem: null,
}


function ToDoList(props) {
  function handleEventClick(item) {
    if (!props.clickToItem) {
      props.clickToItem(item)
    }
  }
  return (
    <ul>
      {props.listToDo.map(item => {
        return <li key={item.id} onClick={handleEventClick(item)}>{item.title}</li>
      })}
    </ul>
  );
}

export default ToDoList;
